import React, { Component } from 'react';

class SearchBar extends Component {
    render(props) { 
        return ( 
            <div>
                <input 
                    value={this.props.searchText}
                    onKeyDown={() => this.props.handleText(this.event)}
                />
            </div>
         );
    }
}

export default SearchBar;
